import React, { Component } from 'react'

export class LogInForm extends Component {
    constructor(props) {
        super(props);
        this.state = {}
    }


    render() {
        return (
            <div>
                <form>
                    <label>User name:</label><br />
                    <input type="text"></input><br />
                    <label>Password:</label><br />
                    <input type="text"></input><br />
                    <input type="submit" value="Log in" />
                </form>
            </div>
        )
    }
}

export default LogInForm
